	distance (a, b) {
		function deg2rad(deg) {
			return deg * (Math.PI/180)
		}
		const R = 6373.0                // Radius of the earth in km
		let dLat = deg2rad(this.places[a]["lat"] - this.places[b]["lat"])
		let dLong = deg2rad(this.places[a]["long"] - this.places[b]["long"])
		let A =  Math.sin(dLat/2) * Math.sin(dLat/2) + Math.cos(deg2rad(this.places[a]["lat"])) * Math.cos(deg2rad(this.places[b]["lat"])) * Math.sin(dLong/2) * Math.sin(dLong/2) 
		let C = 2 * Math.atan2(Math.sqrt(A), Math.sqrt(1-A)) 
		let D = R * C                 // Distance in km
		//console.log("D is " + D )
		return D
	}
	
	dijkstras() {
		//console.log(this.source)

		var pq = new PriorityQueue()
		pq.push(this.source)

		//console.log("hi")
		//console.log(this.source)
		//console.log(this.sink)

		distances[this.source] = 0;

		for (let place in this.places) {
			//console.log("place is "+  place)
			if (this.places[place]["id"] != this.source) 
				{distances[this.places[place]["id"]] = null}
			prev[this.places[place]["id"]] = null
		}
		prev[this.source] = -1

		let t3 = performance.now()
		let first = 0

		while (!pq.isEmpty()) {
			let currPlace = pq.pop()
			//console.log("Popped off priority queue:" + currPlace)
			if (currPlace == this.sink && first == 0) {
				t3 = performance.now()
				first = 1
			}

			for (let neighbor of this.places[currPlace]["neighbors"]) {
				//console.log("in neighbors with neighbor: " + neighbor)
				//console.log(distances[currPlace])
				//console.log("now compare distances. if adding this node has a less distance than already recorded, added it")
				//console.log("current distance of neighbor: " + distances[neighbor])
				let temp = distances[currPlace] + this.distance(currPlace, neighbor)
				//console.log("how much distance is with neighbor node: " + temp)
				if ((distances[neighbor] == null || temp < distances[neighbor])) {
					//console.log("setting new neighbor distance")
					distances[neighbor] = temp
					prev[neighbor] = currPlace
					pq.push(neighbor)
					//console.log("adding to priority queue")
					//console.log(pq)
				}
			}
		}
		return [distances[this.sink], t3]
	}

	get_unsuc_path(k) {
		var unsuc_path = []
		//var edge = 0
		//counter = 0

		if (prev[k] == null || prev[k] == -1) {
			//console.log("here null" + k)
		}

		else {
			//console.log("here entering" + k)
			var p_lat = this.places[prev[k]]["lat"]
			var p_long = this.places[prev[k]]["long"]
			var parent_coords = {lat: p_lat, lng: p_long}

			var c_lat = this.places[k]["lat"]
			var c_long = this.places[k]["long"]
			var child_coords = {lat: c_lat, lng: c_long}
			unsuc_path.push(parent_coords)
			unsuc_path.push(child_coords)
			//edge = 1
		}

		//console.log(unsuc_path)

		return unsuc_path
	}

	get_op_path() {
		var op_path = []
		var parent = this.sink
		while(parent != -1) {
			var p_lat = this.places[parent]["lat"]
			var p_lng = this.places[parent]["long"]
			var coords = {lat: p_lat, lng: p_lng}
			parent = prev[parent]
			op_path.push(coords)
		}

		return op_path
	}
